import React, { useContext } from "react";
import ListItemButton from "@mui/material/ListItemButton";
import ListItemIcon from "@mui/material/ListItemIcon";
import ListItemText from "@mui/material/ListItemText";
import ListSubheader from "@mui/material/ListSubheader";
import { Link, NavLink } from "react-router-dom";

function NavBar() {
  return (
    <React.Fragment>
      <ListItemButton>
        <ListItemIcon>
          <span class="material-symbols-outlined">dashboard</span>
        </ListItemIcon>
        <NavLink style={{ textDecoration: "none" }} to="/" underline="none">
          <ListItemText primary="Dashboard" />
        </NavLink>
      </ListItemButton>
      <ListItemButton>
        <ListItemIcon>
          <span class="material-symbols-outlined">groups</span>
        </ListItemIcon>
        <NavLink style={{ textDecoration: "none" }} to="/clients">
          <ListItemText primary="Clients" />
        </NavLink>
      </ListItemButton>
      <ListItemButton>
        <ListItemIcon>
          <span class="material-symbols-outlined">shopping_cart</span>
        </ListItemIcon>
        <NavLink style={{ textDecoration: "none" }} to="/orders">
          <ListItemText primary="Orders" />
        </NavLink>
      </ListItemButton>
      <ListItemButton>
        <ListItemIcon>
          <span class="material-symbols-outlined">inventory</span>
        </ListItemIcon>
        <NavLink style={{ textDecoration: "none" }} to="/food">
          <ListItemText primary="Inventory" />
        </NavLink>
      </ListItemButton>
      <ListItemButton>
        <ListItemIcon>
          <span class="material-symbols-outlined">add</span>
        </ListItemIcon>
        <NavLink style={{ textDecoration: "none" }} to="/purchases">
          <ListItemText primary="Purchases" />
        </NavLink>
      </ListItemButton>
    </React.Fragment>
  );
}

